    public HashMap<String, String> getCosmeticPostParamsMap() {
        HashMap<String, String> paramsMap = new HashMap<String, String>();
        paramsMap.put(appIdKey, String.valueOf(appId));
        paramsMap.put(timestampKey, String.valueOf(timestamp));
        paramsMap.put(nonceKey, nonceStr);
        paramsMap.put(imageKey, image);
        return paramsMap;
    }

    public void parseImage(String jsonContent) throws IOException {
        JSONObject jsonObject = (JSONObject) JSON.parseObject(jsonContent);
        int ret = jsonObject.getInteger("ret");
        String msg = jsonObject.getString("msg");

        ErrorCodeEnum errorCodeEnum = ErrorCodeEnum.valueOf(ret);
        if(errorCodeEnum != null) {
            System.out.println("返回code=" + ret + ", " + errorCodeEnum.getDesc());
            System.out.println("返回msg：" + msg);

        }
        JSONObject dataObj = jsonObject.getJSONObject("data");
        String imageBase64Str = dataObj.getString("image");

        if(StringUtils.isNotEmpty(imageBase64Str)) {
            System.out.println("image:");
            System.out.println(imageBase64Str);
            String picOut = getOutFilePath(picPath);
            FileUtils.base64StrToFile(imageBase64Str, picOut);
        } else {
            System.out.println("image 字段为空!");
        }

    }

    private String getOutFilePath(String picPath) {
        String outPath = picPath.substring(0, picPath.lastIndexOf("."));
        outPath = outPath + "_after-cosmetic.jpg";
        return outPath;
    }

